column3:
Материал: пластик, металл, электронные компоненты
Размер: 35 × 25,5 × 13 см
Упаковка: PP-пакет + композитный пенополиэтилен + картонная коробка
Цвет: красный, черный, голубой
Серты: ДС и СС (входят в стоимость)
Технички: 
Функция проигрывания винила / винил + Bluetooth / винил + Bluetooth + USB — 3 варианта на выбор;
Аудиовыход и аудиовход;
Разъём для наушников;
Отношение сигнал/шум: 90 дБ;
Адаптер: 5V–2A;
Мощность динамиков: 4 Ом, 3 Вт × 2;
Частотный диапазон: 150 Гц – 20 кГц;
Поддержка пластинок: 7", 10", 12";
Скорости вращения: 33 / 45 / 78 об/мин.
